pragma solidity ^0.8.0;
pragma abicoder v2;

contract CheckWeights {
    mapping(uint => string[]) roundWeightsReference;

    uint[] public blacklist;

    address private owner;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function.");
        _;
