    //             return true;
    //         }
    //     }
    //     return false;
    // }

    function addToBlacklist(uint _federatedCid) public {
        blacklist.push(_federatedCid);
    }

    function getBlacklist() public view onlyOwner returns (uint[] memory) {
        return blacklist;
    }

